style.css:
@-moz-document domain("time.is") {
/* https://time.is/ */

body {
    background: #212529;
    color: #fff;
}

#mainwrapper {
    background: #212529;
}

#favs li a {
    background-color: #1b1f22;
}

.mt #favs li span {
    color: #fff;
}

.tbx a {
    border: 1px solid #3c3c3c;
}

.tbx a:hover {
    border-color: #ccc;
}

a:link, a:visited {
    color: #fff;
    text-decoration: none;
    border-bottom: 1px solid #ccc;
}

.transitiondate {
    background: #2b3035;
}

.onedate:hover .transitiondate {
    background: #2b3035;
}

section#time_zone {
    background: #212529;
}

#time_zone div, #time_zone li {
    color: #fff;
}

section#time_zone h1, section#time_zone h1 span {
    color: #fff;
}

#pL a:link, #pL a:visited, #pL1 a, #lC, #daydiv, #daydiv1 {
    color: #fff;
}


/* https://time.is/en/Unix_time_converter */

.inputframe {
    background: #2b3035;
    border: 1px solid #495057;
    border-radius: 0.375rem;
}

.inputframe input {
    background: #6c757d;
}

.mout, div .hovered {
    border-color: #7b7b7b;
    color: #fff;
}

label {
    color: #fff;
}

/* https://time.is/compare */
.txtin, .dateinput {
    background: #6c757d;
}

div .hovered {
    background: #6c757d;
}

input.blankloc {
    color: #fff;
}

input.focused, textarea.focused {
    background: #6c757d;
    border-color: #999;
    color: #000;
}

.popc .month {
    background: #2b3035;
    border: 1px solid #495057;
}

.caln td div {
    color: #fff;
    border: 1px solid #495057;
}

div .button {
    color: #fff;
    background: #6c757d;
}

div .button:hover {
    color: #fff;
    background: #6c757d;
}
}
